    false,nt"url": null,nt"notes": "World Ocean Atlas 2013 (WOA13) is a set
    of objectively analyzed (1 degree grid and 1/4 degree grid) climatological fields
    of in situ temperature, salinity, dissolved oxygen, Apparent Oxygen Utilization,
    percent oxygen saturation, phosphate, silicate, and nitrate at standard depth levels
    for annual, seasonal, and monthly compositing periods for the World Ocean. 1/4 degree
    fields are for temperature and salinity only. It also includes associated statistical
    fields of observed oceanographic profile data interpolated to standard depth levels
    on 1/4 degree, 1 degree, and 5 degree grids. Temperature and salinity fields are
    available for six decades (1955-1964, 1965-1974, 1975-1984, 1985-1994, 1995-2004,
    and 2005-2012) and an average of all decades representing the period 1955-2012.
    Nutrient and oxygen fields are available using all quality controlled data for the
    entire sampling period 1878-2012.",nt"license_title": "License Not Specified",nt"extras":
